const butter = Butter('2fa7babaa7064c23b2cb90171957b2add0333e77')


export default class HomeView extends Component {
    constructor(props) {
        super(props);

        this.props = props;
        this.state = {sitePosition : "home", data:{}};
      this.getPageInformation(this.state.sitePosition)
      }


  async getPageInformation(link) {
      const resp = await butter.page.retrieve('*', ''+link+'');
      this.setState(resp.data);
      console.log(resp.data);

    }


  render() {
    console.log(this.state.data.fields);
    // eslint-disable-next-line
    return (
      <div className="pageWrapper">        
        <div className="pageTopDivider"></div>
        {this.state.data.fields.map()}
        <div className="divider"></div>
        <div className="divider"></div>
      </div>
    );
  }


}

